import React from "react";
import carMarket from "./data.js";
import "./App.css";
import Nav from "./components/nav/Nav.js";

function App() {
  const getAllButtonsLable = (data) => {
    let res = [];
    for (let key in data) {
      res.push(key);
    }
    console.log(res);
  };
  getAllButtonsLable(data);
  return (
    <div className="nav">
      <Nav />
    </div>
  );
}

export default App;
